import React, { useState } from "react";
// import DateTimePicker from 'react-datetime-picker';
// import {DateTimePickerComponent} from '@syncfusion/ej2-react-calendars'
function Todo(){
    const [todo, setTodo] = useState({
        dueTime : "",
        title : "abcd",
        body : "body",
        status : ""
    });
    // const [todo, setTodo] = useState();
    return (
        <form>
            <label>title:
                <input 
                type = "text"
                value = {todo.title}
                onChange = {(e) =>{ 
                    todo.title = e.target.value;
                    setTodo(todo)
                    }
                }
                />
            </label>
            <p>{todo.body}</p>
        </form>
    );
}

export default Todo

